import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Components/home/Home";
import Action from "./Components/action/Action";

function App() {
    return (

        <BrowserRouter>
            <Routes>
                <Route path = {"/"} element = {<Home />} />
                <Route path={"/actions"} element={<Action/>}/>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
